Signals are a Inter-Process Communication (IPC) mechanism. They are used to notify a process when an event has occured. Signal delivery is similar to the delivery of hardware interrupts. A proceess can only send signals to another process if it has the correct permissions to do so: The real or effective user ID of the receiving process must match that of the sending process, or the user must have the appropriate privileges. The kernel can send signals to any process. Signals are generated: when an exeception occurs (e.g. division by zero = SIGFPE, segment violation = SIGSEGV). when the kernel wants to notify the process of an event that has occured (e.g. if the process writes to a closed pipe = SIGPIPE). when the user enters certain key combinations (e.g. CTRL+C = SIGINT). when using the kill system call. All of the UNIX signals are as follows (from man signal): SIGHUP: terminal line hangup SIGINT: interrupt program SIGQUIT: quit program SIGILL: illegal instruction SIGTRAP: trace trap SIGABRT: abort program (formerly SIGIOT) SIGEMT: emulate instruction executed SIGFPE: floating-point exception SIGKILL: kill program SIGBUS: bus error SIGSEGV: segmentation violation SIGSYS: non-existent system call invoked SIGPIPE: write on a pipe with no reader SIGALRM: real-time timer expired SIGTERM: software termination signal SIGURG: urgent condition present on socket SIGSTOP: stop (cannot be caught or ignored) SIGTSTP: stop signal generated from keyboard SIGCONT: continue after stop SIGCHLD: child status has changed SIGTTIN: background read attempted from control terminal SIGTTOU: background write attempted to control terminal SIGIO: I/O is possible on a descriptor (see fcntl(2)) SIGXCPU: cpu time limit exceeded (see setrlimit(2)) SIGXFSZ: file size limit exceeded (see setrlimit(2)) SIGVTALRM: virtual time alarm (see setitimer(2)) SIGPROF: profiling timer alarm (see setitimer(2)) SIGWINCH: Window size change SIGINFO: status request from keyboard SIGUSR1: User defined signal 1 SIGUSR2: User defined signal 2 The default action for most signals is to terminal the process, however the receiving process can choose to: ignore the signal. handle the signal by installing a signal handler. The two exceptions are SIGKILL and SIGSTOP, which cannot be ignored or handled. An example signal handler is: #include <signal.h>
#include <stdio.h> void sigint_handler(int sig) { fprintf(stderr, " => SIGINT caught!\n");
} int main(int argc, char *argv[]) { signal(SIGINT, sigint_handler); // installs sigint_handler while (1) {}
} $ gcc a.c && ./a.out || pkill a.out
