int pipe(int fd[2]) pipe returns two file descriptors: fd[0]: the read end of the pipe (sender should close). fd[1]: the write end of the pipe (receiver should close). If a receiver reads from an empty pipe, it blocks until data is written at the other end. If the sender writes to a full pipe, it blocks until the data is read at the other end and the pipe is cleared. An example of pipe is: #include <assert.h>
#include <stdio.h>
#include <stdlib.h>
#include <unistd.h>
#include <sys/wait.h>
#include <string.h> int main(int argc, char *argv[]) { int fd[2]; char buf; assert(argc == 2); if (pipe(fd) == -1) { exit(1); } if (fork() != 0) { close(fd[0]); write(fd[1], argv[1], strlen(argv[1])); close(fd[1]); waitpid(-1, NULL, 0); } else { close(fd[1]); while(read(fd[0], &buf, 1) > 0) { printf("%c", buf); } printf("\n"); close(fd[0]); }
} $ gcc a.c && ./a.out "hello world"
